// Convert a string such as "\"c:\\windows\\\"" into "c:\windows\"             <--------------------------
// "another testcase"                                                          <--------------------------
// "and another                                                                <--------------------------
let normalizeString (str : string) =
    let str = str.Replace("\\\"", "\"")
    let str = str.Replace("\\\\", "\\")
    if str.[0] = '\"' && str.[str.Length - 1] = '\"' then
        str.Substring(1, str.Length - 2)
    else
        str


